// export default Levels

import React,{useState} from 'react';
import './lock.css';


function Levels({ score ,target}) {
    const [level,setLevel]=useState(1);
    useEffect(() => {
        if (score >= target) {
          setLevel(prevLevel => prevLevel + 1);
        }
    }, [score, target]);
    const unlockLevel = (index) => {
        return index < level  ? index+1 : <i className="fa-solid fa-lock"></i>;
    };

  return (
    <div className="lmain">
        <div className="lbox">
            <div className="lrow">
                <div className="lgrid" id='ll1'>{unlockLevel()}</div>
                <div className="lgrid" id='ll5'>{unlockLevel()}</div>
                <div className="lgrid" id='ll9'>{unlockLevel()}</div>
                <div className="lgrid" id='ll13'>{unlockLevel()}</div>
            </div>
            <div className="lrow">
                <div className="lgrid" id='ll2'>{unlockLevel()}</div>
                <div className="lgrid" id='ll6'>{unlockLevel()}</div>
                <div className="lgrid" id='ll10'>{unlockLevel()}</div>
                <div className="lgrid" id='ll14'>{unlockLevel()}</div>
            </div>
            <div className="lrow">
                <div className="lgrid" id='ll3'>{unlockLevel()}</div>
                <div className="lgrid" id='ll7'>{unlockLevel()}</div>
                <div className="lgrid" id='ll11'>{unlockLevel()}</div>
                <div className="lgrid" id='ll15'>{unlockLevel()}</div>
            </div>
            <div className="lrow">
                <div className="lgrid" id='ll4'>{unlockLevel()}</div>
                <div className="lgrid" id='ll8'>{unlockLevel()}</div>
                <div className="lgrid" id='ll12'>{unlockLevel()}</div>
                <div className="lgrid" id='ll16'>{unlockLevel()}</div>
            </div>
        </div>
        <div className='btn-group w-100'>
            <button className="btn btn-warning"><i className="fa-solid fa-chevron-left"></i>&nbsp;&nbsp;&nbsp;&nbsp;Previous</button>
            <button className="btn btn-primary">Next&nbsp;&nbsp;&nbsp;&nbsp;<i className="fa-solid fa-chevron-right"></i></button>
        </div>
    </div>
  )
}

export default Levels;
